import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import "./Cart.css";  // Add your styling here

// Define the base URL for API
const API_BASE_URL = "http://localhost:8000/medical_store_app/api";

export default function Cart() {
  const [cartItems, setCartItems] = useState([]);
  const [totalPrice, setTotalPrice] = useState(0);

  useEffect(() => {
    fetchCartItems(); // Initially fetch cart items
  }, []);

  // Fetch cart items for the logged-in user
  const fetchCartItems = async () => {
    try {
      const response = await axios.get(`${API_BASE_URL}/cart/`, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem("access_token")}`, // Assuming JWT token is stored in localStorage
        },
      });
      setCartItems(response.data);

      // Calculate total price
      let price = 0;
      response.data.forEach(item => {
        price += item.medicine.price * item.quantity;
      });
      setTotalPrice(price);
    } catch (error) {
      console.error("Error fetching cart items:", error);
    }
  };

  // Remove item from cart
  const removeFromCart = async (itemId) => {
    try {
      await axios.delete(`${API_BASE_URL}/cart/${itemId}/`, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem("access_token")}`,
        },
      });
      setCartItems(cartItems.filter(item => item.id !== itemId)); // Update the UI after removing
    } catch (error) {
      console.error("Error removing item from cart:", error);
    }
  };

  // Handle checkout or order submission (you can integrate with your order API)
  const handleCheckout = async () => {
    // Implement checkout logic or API call to submit the order
    console.log("Proceeding to checkout");
  };

  return (
    <div className="cart-page">
      <header className="navbar">
        <h1>Medical Store - Cart</h1>
        <div className="nav-options">
          <Link to="/" className="nav-button">Home</Link>
          <Link to="/Login" className="nav-button">Login/Register</Link>
        </div>
      </header>

      <main className="cart-content">
        <h2>Your Cart</h2>

        {cartItems.length === 0 ? (
          <p>Your cart is empty. Add some medicines!</p>
        ) : (
          <div className="cart-items">
            {cartItems.map(item => (
              <div key={item.id} className="cart-item">
                <h3>{item.medicine.name}</h3>
                <p>Price: ${item.medicine.price}</p>
                <p>Quantity: {item.quantity}</p>
                <button
                  className="remove-button"
                  onClick={() => removeFromCart(item.id)}
                >
                  Remove from Cart
                </button>
              </div>
            ))}
          </div>
        )}

        <div className="cart-summary">
          <h3>Total Price: ${totalPrice.toFixed(2)}</h3>
          {cartItems.length > 0 && (
            <button className="checkout-button" onClick={handleCheckout}>
              Proceed to Checkout
            </button>
          )}
        </div>
      </main>

      <footer className="footer">
        <p>&copy; 2024 Medical Store. All rights reserved.</p>
      </footer>
    </div>
  );
}

// Inline CSS styles
const styles = {
  cartPage: {
    maxWidth: "600px",
    margin: "2em auto",
    padding: "1em",
    background: "#fff",
    borderRadius: "8px",
    boxShadow: "0 0 10px rgba(0, 0, 0, 0.1)",
  },
  cartTitle: {
    fontSize: "24px",
    marginBottom: "1em",
    textAlign: "center",
  },
  emptyCart: {
    textAlign: "center",
    fontSize: "16px",
  },
  cartList: {
    listStyle: "none",
    padding: "0",
  },
  cartItem: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "0.5em 0",
    borderBottom: "1px solid #ddd",
  },
  medicineName: {
    fontSize: "18px",
  },
  price: {
    fontSize: "16px",
  },
  quantity: {
    fontSize: "16px",
  },
  removeButton: {
    padding: "5px 10px",
    color: "#fff",
    backgroundColor: "#e74c3c",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
  },
  cartTotal: {
    marginTop: "1em",
    fontSize: "18px",
    textAlign: "right",
  },
  checkoutButton: {
    padding: "10px 20px",
    color: "#fff",
    backgroundColor: "#2ecc71",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
  },
};
